    "top10_b = raw_b_2.groupby([\"type_of_business\"])[\"amount\"].sum().sort_values(ascending=False).head(10).reset_index()\n",
    "top10_c = raw_c_2.groupby([\"type_of_business\"])[\"amount\"].sum().sort_values(ascending=False).head(10).reset_index()\n",
